import React from 'react';
import PopulateCharacters from './PopulateCharacters';

function ShowUserCharacters(props){

    for(character in props.currentUser.characters){
        return(
            <div className="UserCharacters">
                {PopulateCharacters(props.currentUser)}
            </div>
        )
    }

}

export default ShowUserCharacters;
